function info(value){
itemList.insertAdjacentHTML(
    "beforeend",
    `<div class="col-xs-4 col-md-2"><img id=${value.name} src=${value.iconURL} onclick="show(this.id, ${value.emission})" class="img-responsive image"/></div>`
);
}

